import axios from 'axios'
import { GET_ALL_TEACHERS } from '../types'

export const getAllTeachers =()=> dispatch => {
    axios.get("http://localhost:8080/teacher/all")
    .then(response => {
        console.log("ALL TEACHERS")
        dispatch({
            type: GET_ALL_TEACHERS,
            payload: response.data
        })
    })
}

export const removeTeacher =()=> dispatch => {
    axios.get("http://localhost:8080/teacher/delete/")
}
